21. Merge Two Sorted Lists.html.body:
21. Merge Two Sorted Lists
Merge two sorted linked lists and return it as a new list. The new list should be made by splicing together the nodes of the first two lists.
Example:
Input: 1->2->4, 1->3->4
Output: 1->1->2->3->4->4

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */
func mergeTwoLists(l1 *ListNode, l2 *ListNode) *ListNode {
    // 把l1与l2中所有元素取出来放到res数组，对res数组进行排序
    var res []int
    for l1 != nil {
        res = append(res, l1.Val)
        l1 = l1.Next
    }
    for l2 != nil {
        res = append(res, l2.Val)
        l2 = l2.Next
    }
    sort.Ints(res)

    // 从res数组中取出所有元素并串成一个链表
    dummy := new(ListNode)
    pre := dummy
    for _, v := range res {
        node := new(ListNode)
        node.Val = v

        pre.Next = node
        pre = pre.Next
    }
    return dummy.Next
}

23. Merge k Sorted Lists.html.body:
23. Merge k Sorted Lists
Merge k sorted linked lists and return it as one sorted list. Analyze and describe its complexity.
Example:
Input:
[
  1->4->5,
  1->3->4,
  2->6
]
Output: 1->1->2->3->4->4->5->6

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */
func mergeKLists(lists []*ListNode) *ListNode {
    // 把所有链表中所有元素放到res数组中，对这个数组进行排序。
    var res []int
    for _, list := range lists {
        for list != nil {
            res = append(res, list.Val)
            list = list.Next
        }
    }
    sort.Ints(res)

    // 把数组中所有元素取出来，串成一个链表返回。
    dummy := new(ListNode)
    pre := dummy
    for _, v := range res {
        node := &ListNode{Val: v}
        pre.Next = node
        pre = pre.Next
    }
    return dummy.Next
}

82. Remove Duplicates from Sorted List I.body:
82. Remove Duplicates from Sorted List II
Given a sorted linked list, delete all nodes that have duplicate numbers, leaving only distinct numbers from the original list.
Example 1:
Input: 1->2->3->3->4->4->5
Output: 1->2->5
Example 2:
Input: 1->1->1->2->3
Output: 2->3

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */
func deleteDuplicates(head *ListNode) *ListNode {
    // 这个head1为了下面再遍历一次链表使用，因为遍历一遍head后，指针已经到了最后一个位置，回不到开头。
    head1 := &ListNode{Next: head}  

    // 将所有元素保存到一个map中，统计每个元素出现的个数
    set := make(map[int]int)
    for head != nil {
        set[head.Val]++
        head = head.Next
    }

    dummy := new(ListNode)
    pre := dummy

    // 再遍历一遍链表，如果当前元素出现个数为1，则把当前元素加入dummy中。
    head1 = head1.Next
    for head1 != nil {
        if set[head1.Val] == 1 {
            node := new(ListNode)
            node.Val = head1.Val

            pre.Next = node
            pre = pre.Next
        }
        head1 = head1.Next
    }
    return dummy.Next
}

101. Symmetric Tree.html.body:
101. Symmetric Tree
Given a binary tree, check whether it is a mirror of itself (ie, symmetric around its center).
For example, this binary tree [1,2,2,3,4,4,3] is symmetric:
    1
   / \
  2   2
 / \ / \
3  4 4  3
But the following [1,2,2,null,3,null,3] is not:
    1
   / \
  2   2
   \   \
   3    3
Note:
Bonus points if you could solve it both recursively and iteratively.

Go solution:
/**
 * Definition for a binary tree node.
 * type TreeNode struct {
 *     Val int
 *     Left *TreeNode
 *     Right *TreeNode
 * }
 */
func isSymmetric(root *TreeNode) bool {
    return isSym(root, root)
}

// 辅助函数，判断树是否为镜像对称。
func isSym(L *TreeNode, R *TreeNode) bool {
    if L == nil && R == nil { // 如果两个节点都为空，返回true
        return true
    }
    if L != nil && R != nil && L.Val == R.Val {
        return isSym(L.Left, R.Right) && isSym(L.Right, R.Left)  //核心代码。当前左树的左节点必须与右树的右节点值相等；当前左树的右节点必须与右树的左节点值相等。可以在纸上一棵树走一遍这个函数，很快就能理解。
    }
    return false
}

Python solution:
# Definition for a binary tree node.
# class TreeNode(object):
#     def __init__(self, x):
#         self.val = x
#         self.left = None
#         self.right = None

class Solution(object):
    def isSymmetric(self, root):
        """
        :type root: TreeNode
        :rtype: bool
        """
        def isSym(L,R):
            if not L and not R:
                return True
            if L and R and L.val==R.val:
                return isSym(L.left,R.right) and isSym(L.right,R.left)

            return False
        return isSym(root,root)

