148. Sort List
Sort a linked list in O(n log n) time using constant space complexity.
Example 1:
Input: 4->2->1->3
Output: 1->2->3->4
Example 2:
Input: -1->5->3->4->0
Output: -1->0->3->4->5

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */

func sortList(head *ListNode) *ListNode {
    // 遍历链表将元素放到res数组里并排序
    var res []int
    for head != nil {
        res = append(res, head.Val)
        head = head.Next
    }
    sort.Ints(res)

    // 把res里所有元素串起来返回
    dummy := new(ListNode)
    pre := dummy
    for _, v := range res {
        node := new(ListNode) //注意这种写法
        node.Val = v

        pre.Next = node
        pre = pre.Next
    }
    return dummy.Next
}

203. Remove Linked List Elements.html.body:
203. Remove Linked List Elements
Remove all elements from a linked list of integers that have value val.
Example:
Input:  1->2->6->3->4->5->6, val = 6
Output: 1->2->3->4->5

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */
func removeElements(head *ListNode, val int) *ListNode {
    // 将链表中所有值不等于val的元素放到res列表中
    var res []int
    for head != nil {
        if head.Val != val {
            res = append(res, head.Val)
        }
        head = head.Next
    }
    // 将res中每个元素串成一个链表返回
    dummy := new(ListNode)
    pre := dummy
    for _, v := range res {
        node := &ListNode{Val: v}
        pre.Next = node
        pre = pre.Next
    }
    return dummy.Next
}

206. Reverse Linked List.html.body:
206. Reverse Linked List
Reverse a singly linked list.
Example:
Input: 1->2->3->4->5->NULL
Output: 5->4->3->2->1->NULL
Follow up:
A linked list can be reversed either iteratively or recursively. Could you implement both?

/**
 * Definition for singly-linked list.
 * type ListNode struct {
 *     Val int
 *     Next *ListNode
 * }
 */
func reverseList(head *ListNode) *ListNode {
    //遍历链表，将元素放到一个数组里面
    var arr []int
    for head != nil {
        arr = append(arr, head.Val)
        head = head.Next
    }

    dummy := new(ListNode)
    pre := dummy
    // go没有好的reverse方法，只能采用这种低级方法倒序遍历了
    for i := len(arr) - 1; i >= 0; i-- {
        node := new(ListNode)
        node.Val = arr[i]

        pre.Next = node
        pre = pre.Next
    }

    return dummy.Next
}

